atob("bTN0NGQ0dDRfaDBsZHM=")
// Result: "m3t4d4t4_h0lds"

// Step 2: Apply ROT13
rot13("m3t4d4t4_h0lds")
// Result: "z3g4q4g4_u0yqf"

// Final key found!`}},{type:"KeyTakeaways",props:{title:"Forensics Tips",points:["Always check file metadata - comments often contain secrets","Look for encoded strings (Base64 often ends with =)","Try common transformations: Base64, ROT13, hex","Cookie values can be modified via DevTools","Chain multiple techniques together","Document your findings as you go"]}}]}]}};function ny(l){return ty[l]||null}const sy={search:Jt,target:Je,zap:Ji,coins:dg,"file-text":jo,key:Jn,lock:ct,unlock:na,repeat:gh,shuffle:yh,save:vh,"trash-2":Ki,terminal:Vt,flag:ph};function Uu(l){return l&&l.replace(/[]/g,"").trim()}function ry({leftTitle:l,rightTitle:c,leftCode:o,rightCode:h}){const p=o||"",m=h||"",g=Uu(l)||"Insecure Version",w=Uu(c)||"Fixed Version",y=g.toLowerCase().includes("insecure")||g.toLowerCase().includes("vulnerable")||g.toLowerCase().includes("dangerous")||g.toLowerCase().includes("false"),b=w.toLowerCase().includes("secure")||w.toLowerCase().includes("safe")||w.toLowerCase().includes("fixed");return e.jsxs("div",{className:"comparison-cards",children:[e.jsxs("div",{className:`comparison-card ${y?"insecure":"neutral"}`,children:[e.jsxs("div",{className:"comparison-header",children:[y?e.jsx(Ex,{size:18}):e.jsx(co,{size:18}),e.jsx("span",{children:g})]}),e.jsx("div",{className:"comparison-content",children:e.jsx("pre",{children:e.jsx("code",{children:p})})})]}),e.jsx("div",{className:"comparison-arrow",children:e.jsx(An,{size:24})}),e.jsxs("div",{className:`comparison-card ${b?"secure":"neutral"}`,children:[e.jsxs("div",{className:"comparison-header",children:[b?e.jsx(Zn,{size:18}):e.jsx(co,{size:18}),e.jsx("span",{children:w})]}),e.jsx("div",{className:"comparison-content",children:e.jsx("pre",{children:e.jsx("code",{children:m})})})]})]})}function iy({title:l,steps:c}){return e.jsxs("div",{className:"flow-diagram-container",children:[l&&e.jsx("h4",{className:"flow-title",children:l}),e.jsx("div",{className:"flow-diagram",children:c.map((o,h)=>{const p=o.icon&&sy[o.icon];